window.vm=new Vue({el:"#vue",data:{clocks:[]},methods:{update:function(){var t,e=moment(),n=e.clone().tz("Asia/Tokyo"),o=e.clone().tz("America/Los_Angeles");this.clocks=[{time:n},{time:6<=(t=n.hour())&&t<22?n:o,tz:"MLT"},{time:o}],this.clocks.forEach((function(t){t.tz||(t.tz=t.time.format("z")),t.tz_name||(t.tz_name={JST:"日本標準時",PST:"太平洋標準時",PDT:"太平洋夏時間",MLT:"マミー生活時間"}[t.tz])}))}},mounted:function(){var t=this;setInterval((function(){return t.update()}),500),this.update()}});